import React from "react";
import Link from "next/link";

const mainPage = () => (
  <div>
    <h1>Welcome to main!</h1>
    <p>
      To:
      <Link href="/auth">
        <a>Auth</a>
      </Link>
    </p>
  </div>
);

export default mainPage;
